description:
Spin Doctors - Jimmy Olsen's Blues [promo].VOB



HQ promo video. The album's title is a reference to Kryptonite, a 
fictional substance from the Superman comic book series. The title is 
taken from the album's opening track, &quot;Jimmy Olsen's Blues&quot;, a reference 
to Superman supporting character Jimmy Olsen, who is attracted to Lois Lane 
and jealous of her romantic feelings for Superman.


